import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";
import { Menu } from "antd";

const AppLayout = ({ children }) => {
  return (
    <div>
          <Link href="/">
            <a>메인화면</a>
          </Link>
          <Link href="/profile">
            <a>프로필</a>
          </Link>
          <Link href="/signup">
            <a>회원가입</a>
          </Link>
      {children}
    </div>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
